import 'date-fns';
import React, {Component,Fragment} from "react";
import TextField from '@material-ui/core/TextField';
import AddEventHeader from './AddEventHeader';
import SwitchSection from '../SwitchSection';
import history from '../../history';
import DateSection from '../DateSection';
import Alert from '../Alert'
import Button from '@material-ui/core/Button';
import MapContainer from '../../MapContainer';
import TextareaAutosize from '@material-ui/core/TextareaAutosize';


class ReportElement extends Component{
    constructor(props){
        super(props);
        this.state = {
            open:"",
            msg:"",
            alertType:"",

        }
    }
      


    render(){
        return(
            <div>
                <div>
                    <div style={{display:"flex",flexDirection:"row",borderRadius:"20px",width:"90%",marginTop:"3px auto",border:"2px solid black"}}>
                        <div>Event Name: asdf </div>
                        <div>Time: </div>
                        <div>
                        </div>
                    </div>
                </div>
                <div>
                    <Alert alertType={this.state.alertType} msg={this.state.msg} open={this.state.open} alertClose={()=>this.setState({open:false})}></Alert>
                </div>
            </div>
        )
    }

}

export default ReportElement;
